import{_ as i}from"./chunks/building1.gP8YNjMo.js";import{_ as l,c as e,o as s,ag as t}from"./chunks/framework.Bw-5EFTY.js";const n="/assets/cloudbuild.D_7jdMud.webp",b=JSON.parse('{"title":"云端打包","description":"","frontmatter":{},"headers":[],"relativePath":"zh/guide/build.md","filePath":"zh/guide/build.md"}'),o={name:"zh/guide/build.md"};function r(p,a,d,c,u,m){return s(),e("div",null,a[0]||(a[0]=[t('<h1 id="云端打包" tabindex="-1">云端打包 <a class="header-anchor" href="#云端打包" aria-label="Permalink to &quot;云端打包&quot;">​</a></h1><p>这一步就是在云端将你的项目编译成跨平台的软件，所以这里只需要选择对应的打包方式和平台即可，发布模式可以选择关闭调试和开启调试，开启后，当软件启动时有问题可以在控制台看到错误信息。发布说明可以添加这次发布主要是哪些内容，可以忽略。一切配置完成后，点击确定，就可以开始打包了。需要耐心等待 8 分钟左右...</p><p><img src="'+n+`" alt=""></p><p>激动人心的等待时刻：(当然也是最容易出错的时刻)</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>成败在此一举</span></span>
<span class="line"><span>如果成功，跳转到发布页面，点击下载即可下载你的软件。</span></span>
<span class="line"><span>如果失败，又上角会有错误提示，可根据错误进行修改或联系我们。</span></span></code></pre></div><p><img src="`+i+'" alt=""></p><h2 id="注意" tabindex="-1">注意： <a class="header-anchor" href="#注意" aria-label="Permalink to &quot;注意：&quot;">​</a></h2><ol><li>发布模式：关闭调试和开启调试，开启后，当软件启动时有问题可以在控制台看到错误信息，页面可以右键打开检查查看调试信息。</li><li>发布说明：可以添加这次发布主要是哪些内容，可以忽略。</li><li>如果发布失败：又上角会出现一个红色的警告图标，点击后会提示错误信息，根据错误信息进行修复即可。</li><li>github 打包失败：会打开 github 的打包页面，根据错误信息进行修复即可。</li><li>打包方式的不同和差异：</li></ol><ul><li>本地打包也不需要安装任何环境，也不用配置token，简直是太牛逼了</li><li>本地打包：没有打包次数限制，打包速度快，缺点是仅支持本机系统，打包体积大（大概 10M 左右）</li><li>云端打包：支持所有主流操作系统，打包体积小（5M 左右），缺点是打包速度慢，有打包时间限制</li><li>本地极速：没有次数限制，速度快，体积小，支持所有主流系统，待开发.....</li><li>云端极速：支持所有主流系统，体积小，时间快，时间限制放宽，待开发.....</li></ul><ol><li>发布平台的不同和差异：</li></ol><ul><li>windows：主流操作系统，有 x86_32 和 x64 和 arm 架构区别，x64 市场最广，注意选择适合自己的系统</li><li>macos：主流操作系统，有 x64 和 arm（m 芯片）架构区别，m 架构好像兼容 x64 版本，优先选择 arm 架构</li><li>linux：非主流操作系统，有 x64 和 Amd64 和 arm 架构区别，x64 的市场最广，注意选择适合自己的系统</li><li>x64 版本的包一般在名称中都包含 x64 关键字，包含 arm 和 aarch64 关键词的名称一般都是 arm 新品的安装包</li></ul><ol start="7"><li>保存路径：本地打包需要先设置好保存路径，如果不设置默认存储到下载路径，点击输入框可以输入路径和选择保存路径。</li><li>如还是失败：可以加入我们群聊咨询相关问题<a href="./../exchange/">社区群聊</a>，我们会尽快帮你解决。</li></ol>',12)]))}const x=l(o,[["render",r]]);export{b as __pageData,x as default};
